const id=getUrlParameter("id");const siteTitle=document.getElementById("siteTitle");getEZCastById(id);function onEZCastLoaded(a){siteTitle.innerHTML=a.name}function getUrlParameter(a){a=a.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var c=new RegExp("[\\?&]"+a+"=([^&#]*)");var b=c.exec(location.search);return b===null?"":decodeURIComponent(b[1].replace(/\+/g," "))};